ATTACH DATABASE 'movies_rating.db' as 'db';
DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS ratings;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS movies_genres;
DROP TABLE IF EXISTS genres;
PRAGMA foreign_keys=on;
CREATE TABLE movies (id INTEGER PRIMARY KEY AUTOINCREMENT, title TEXT NOT NULL, year TEXT NOT NULL);
CREATE TABLE users (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT NOT NULL, surname TEXT NOT NULL, email TEXT NOT NULL UNIQUE, gender TEXT NOT NULL CHECK(gender in ('female', 'male')), register_date TEXT NOT NULL, occupation TEXT NOT NULL);
CREATE TABLE tags (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id INTEGER NOT NULL, movie_id INTEGER NOT NULL, tag TEXT NOT NULL, timestamp TIMESTAMP DEFAULT (strftime('%s', 'now')), FOREIGN KEY (user_id) REFERENCES users(id) on DELETE CASCADE FOREIGN KEY (movie_id) REFERENCES movies(id) on DELETE RESTRICT);
CREATE TABLE ratings (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id INTEGER NOT NULL, movie_id INTEGER NOT NULL, rating REAL NOT NULL CHECK(rating >= 0 or rating <= 5), timestamp TIMESTAMP DEFAULT (strftime('%s', 'now')), FOREIGN KEY (user_id) REFERENCES users(id) on DELETE CASCADE FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE RESTRICT);
CREATE TABLE genres (id INTEGER PRIMARY KEY AUTOINCREMENT, title TEXT NOT NULL);
CREATE TABLE movies_genres (id INTEGER PRIMARY KEY AUTOINCREMENT, movie_id INTEGER NOT NULL, genre_id INTEGER NOT NULL, FOREIGN KEY (movie_id) REFERENCES movies(id) FOREIGN KEY (genre_id) REFERENCES genres(id));
CREATE INDEX surname_index on users (surname);
CREATE INDEX movie_title_index on movies (title);
CREATE INDEX movie_year_index on movies (year);






